import React, { useState } from 'react'
import axios from 'axios'
export default function Yimages() {
    const [msg, setMsg] = useState()
    const [img, setImg] = useState(() => {
        axios.get("http://localhost:5000/data/getimages")
            .then(res => {
                setImg(res.data)
                console.log(res.data)
            })
            .catch(err => console.log(err))
    });
    const show = () => {
        let a = Buffer.from(img[3].data).toString()
        setMsg(a)
    }
    return (
        <div className="container">
            <div className="row">
                <h3>image</h3>
                <button onClick={show}>Click</button>
                {
                    img ?
                    img.map((img,index)=>(
                        <img src={`data:image/jpeg;base64,${Buffer.from(img.data).toString()}`} alt="yourphoto" className="img-responsive"/>
                    ))
                    :
                    ""
                }
                    <img src={`data:image/jpeg;base64,${msg}`} alt="io"/>
                <img src={"data:image/jpeg;base64,"} alt="" />

                <img src={"data:image/jpeg;base64,"} alt="yourphoto" />
            </div>

        </div>
    )
}
